-- Changeset v4-350
PRINT 'Starting changeset 350';
GO

IF OBJECT_ID('dbo.staging_table_350', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.staging_table_350 (
        id INT IDENTITY(1,1) PRIMARY KEY,
        payload NVARCHAR(MAX),
        created_on DATETIME2 DEFAULT SYSUTCDATETIME()
    );
END
GO

GO

GO

GO

GO

GO

IF OBJECT_ID('dbo.proc_transform_350', 'P') IS NOT NULL
    DROP PROCEDURE dbo.proc_transform_350;
GO
CREATE PROCEDURE dbo.proc_transform_350
AS
BEGIN
    SET NOCOUNT ON;
    UPDATE dbo.staging_table_350
    SET payload = LEFT(payload, 1000) + N'|V4-350|';
    SELECT TOP (250) LEFT(payload, 200) FROM dbo.staging_table_350;
END
GO
IF OBJECT_ID('dbo.audit_v4_350', 'U') IS NULL
BEGIN
    CREATE TABLE dbo.audit_v4_350 (aid INT IDENTITY(1,1) PRIMARY KEY, msg NVARCHAR(2000), created_on DATETIME2 DEFAULT SYSUTCDATETIME());
END
GO
EXEC dbo.proc_transform_350;
GO

CREATE INDEX IDX_staging_350_payload ON dbo.staging_table_350 (id);
GO
EXEC sp_updatestats;
GO

PRINT 'Completed changeset 350';
GO
